import React, { useState } from 'react';

const LifeInsuranceCard: React.FC = () => {
  const [isExpanded, setIsExpanded] = useState(false);

  return (
    <div className="relative life-card-container">
      {/* Base Life Insurance Card */}
      <div 
        className={`relative w-[300px] h-[170px] bg-gradient-to-br from-gray-50 to-gray-100 rounded-[34px] p-6 life-card-base cursor-pointer border border-gray-200/50 shadow-lg hover:shadow-xl transition-all duration-300 ${
          isExpanded ? 'z-20' : 'z-10'
        }`}
        onMouseEnter={() => setIsExpanded(true)}
        onMouseLeave={() => setIsExpanded(false)}
      >
        {/* Card Content */}
        <div className="flex justify-between items-start h-full">
          <div className="space-y-4">
            {/* Title */}
            <h3 className="font-satoshi font-semibold text-[32px] text-design-black leading-[1.1em] tracking-tight">
              Life
            </h3>
            {/* Description */}
            <p className="font-satoshi font-light text-[18px] text-design-black leading-[1.3em] max-w-[160px] opacity-90">
              Protect<br />their future
            </p>
          </div>
          {/* Icon with enhanced styling */}
          <div className="relative">
            <div className="w-[52px] h-[52px] bg-white rounded-2xl shadow-md flex items-center justify-center">
              <img 
                src="/images/life-insurance-icon.png" 
                alt="Life Insurance Icon" 
                className="w-[36px] h-[36px] object-contain"
              />
            </div>
          </div>
        </div>
      </div>

      {/* Expanded Content - Overlay */}
      <div 
        className={`absolute top-0 left-0 w-[300px] bg-gradient-to-br from-gray-50 to-gray-100 rounded-[34px] life-card-expanded overflow-hidden shadow-2xl border border-gray-200/50 ${
          isExpanded ? 'h-[364px] opacity-100 z-30' : 'h-[170px] opacity-0 pointer-events-none'
        }`}
        onMouseEnter={() => setIsExpanded(true)}
        onMouseLeave={() => setIsExpanded(false)}
      >
        {/* Expanded Content Container */}
        <div className="p-6 h-full flex flex-col">
          {/* Header Section */}
          <div className="flex justify-between items-start mb-8">
            <div className="space-y-4">
              <h3 className="font-satoshi font-semibold text-[32px] text-design-black leading-[1.1em] tracking-tight">
                Life
              </h3>
              <p className="font-satoshi font-light text-[18px] text-design-black leading-[1.3em] max-w-[160px] opacity-90">
                Protect<br />their future
              </p>
            </div>
            <div className="relative">
              <div className="w-[52px] h-[52px] bg-white rounded-2xl shadow-md flex items-center justify-center">
                <img 
                  src="/images/life-insurance-icon.png" 
                  alt="Life Insurance Icon" 
                  className="w-[36px] h-[36px] object-contain"
                />
              </div>
            </div>
          </div>

          {/* Healthcare Statistics Content */}
          <div className="flex-1 space-y-6">
            {/* Section Title */}
            <div className="border-l-4 border-primary-blue pl-4">
              <h4 className="font-satoshi font-medium text-[16px] text-design-black leading-[1.2em]">
                Healthcare Insights
              </h4>
            </div>

            {/* Bullet Points */}
            <div className="space-y-4">
              {/* First Bullet Point */}
              <div className="flex items-start space-x-3 bg-white/60 rounded-xl p-4 shadow-sm">
                <div className="w-2 h-2 bg-primary-blue rounded-full mt-2 flex-shrink-0"></div>
                <p className="font-satoshi font-normal text-[15px] text-design-black leading-[1.5em]">
                  Indians still pay <span className="font-semibold text-primary-blue">45.98%</span> of all healthcare costs out-of-pocket — one medical bill can wipe out savings.
                </p>
              </div>

              {/* Second Bullet Point */}
              <div className="flex items-start space-x-3 bg-white/60 rounded-xl p-4 shadow-sm">
                <div className="w-2 h-2 bg-primary-blue rounded-full mt-2 flex-shrink-0"></div>
                <p className="font-satoshi font-normal text-[15px] text-design-black leading-[1.5em]">
                  <span className="font-semibold text-primary-blue">₹ 70,558</span> — average health-claim size in FY 24, up <span className="font-semibold text-red-600">11% YoY</span> thanks to medical inflation.
                </p>
              </div>
            </div>
          </div>

          {/* CTA Button */}
          <div className="pt-6">
            <button className="bg-gradient-to-r from-primary-blue to-blue-600 text-button-text font-satoshi font-bold px-6 py-4 rounded-[12px] hover:from-blue-600 hover:to-blue-700 transition-all duration-300 w-full text-[16px] shadow-lg hover:shadow-xl transform hover:scale-[1.02] active:scale-[0.98]">
              Book Safety Call
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LifeInsuranceCard;
